curl -XPOST 'http://localhost:9200/electronic_products/_create/2933' -H 'Content-Type: application/json' -d '{"product_name": "SGM8925/SGM8927", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM8925 (single) and SGM8927 (single with  shutdown) are low offset voltage, low power, voltage  feedback amplifiers. These devices can operate from  1.6V to 5.5V single supply, and consume only 6.4μA  quiescent current. They provide a wide input common  mode voltage range and rail-to-rail output voltage swing.  This feature makes SGM8925/7 appropriate for buffering  ASIC.  The SGM8925/7 offer a gain-bandwidth product of  110kHz and an ultra-low input bias current of 1pA. They  are well suited for piezoelectric sensors, integrators and  photodiode amplifiers.  The SGM8925/7 are designed into a wide range of  applications, such as battery-powered instrumentation,  safety monitoring, portable systems, and transducer  interface circuits in low power systems.  The SGM8925 is available in Green SOT-23-5, SC70-5,  MSOP-8 and SOIC-8 packages. The SGM8927 is  available in Green SOT-23-6, MSOP-8 and SOIC-8  packages. They are specified over the extended -40℃  to +85℃ temperature range.  "}'
